SELECT DISTINCT ?uri 
 WHERE{
  {
   ?s ?p ?uri
   OPTIONAL { ?y <http://www.w3.org/2000/01/rdf-schema#label> ?l . FILTER (?uri = ?y) . }
   FILTER ( !BOUND(?y) AND !isLiteral(?uri) )
  } UNION {
   ?uri ?p ?o
   OPTIONAL { ?y <http://www.w3.org/2000/01/rdf-schema#label> ?l . FILTER (?uri = ?y) . }
   FILTER ( !BOUND(?y) )
  } UNION {
   ?s ?uri ?o
   OPTIONAL { ?y <http://www.w3.org/2000/01/rdf-schema#label> ?l . FILTER (?uri = ?y) . }
   FILTER ( !BOUND(?y) )
  }
} LIMIT 10

