SELECT DISTINCT ?type 
WHERE{
  ?s <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> ?type
  OPTIONAL { ?y <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> ?l . FILTER (?type = ?y) . }
 FILTER ( !BOUND(?y) )
} LIMIT 10
